import mc from "./nav-bar-header.module.scss";
import { useDispatch, useSelector } from "react-redux";

const NavBarHeader = () => {
  const dispatch = useDispatch();

  const handleLoginClick = () => {
    const action = {
      type: "OPEN_LOGIN",
    };
    dispatch(action);
  };

  const { modificator } = useSelector((store) => {
    return { modificator: store.modificatorsReducer };
  });

  const handleLoginHover = (e) => {
    console.log(e);
  };

  return (
    <div className={mc.container}>
      <div className={mc.container_2}>
        <div></div>
        <div className={mc.title}>
          {/* <h1>Geek</h1> */}
          <h1>Verse</h1>
        </div>
        <div className={mc.settings}>
          <button
            onMouseEnter={(e) => handleLoginHover(e)}
            onClick={handleLoginClick}
          >
            <span>Se connecter</span>
          </button>
        </div>
      </div>
    </div>
  );
};

export default NavBarHeader;
